import React, { useState, useEffect } from 'react';
import axios from 'axios';

interface UserDetails {
    Name: string;
    email: string;
    // Add other properties here
}

const Dashboard: React.FC = () => {
    const [userDetails, setUserDetails] = useState<UserDetails | null>(null); // State to hold user details

    useEffect(() => {
        axios.get<UserDetails>('http://localhost:8085/userDetails')
            .then(response => {
                setUserDetails(response.data);
                console.log('Received user details:', response.data);
            })
            .catch(error => {
                console.log('Error fetching user details:', error);
            });
    }, []);

    return (
        <div className="dashboard-container">
            <h1>Welcome to your Dashboard, {userDetails?.Name}</h1>
            {userDetails ? (
                <div>
                    <p>Name: {userDetails.Name}</p>
                    <p>Email: {userDetails.email}</p>
                    {/* Display other user details here */}
                </div>
            ) : (
                <p>Loading user details...</p>
            )}
        </div>
    );
}

export default Dashboard;
